  constructor(props){
    super(props);
    this.state ={
      data: 'welcome to this application'
    }
  }

render(){

  return(
    <div>

      <h1> {this.state.data} </h1>
      <form>
      <label>
        Name: <input type="text" name="name"></input>
      </label>
      <button className="btn btn-primary ">Change</button>

      </form>
    </div>
  )
}
}

ReactDOM.render(<Garage/>, document.getElementById('root'));
